import React from 'react'
import { Container } from '@mui/system'
import { Box, styled } from '@mui/material'
import images from "../media/image1.png"
import {Typography} from '@mui/material'

const Cards = () => {
  const BoxContain = styled(Box)(({theme})=>({
    display:"flex",
    justifyContent:"center",
    gap: theme.spacing(8)
  }));
  return (
    <Container sx={{
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
    }}>
      <div
        style={{
          width: "5%",
          height: "5px",
          backgroundColor: "#000339",
          margin: "0 auto",
        }}
      ></div>
      <Typography
        variant="h3"
        sx={{ fontSize: "35px", fontWeight: "bold", color: "#000339", my: 3 }}
      >
        Works
      </Typography>
<BoxContain >
<Box sx={{border:"solid 4px grey", borderRadius:"5px", boxShadow:"inherit"}}>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>


<Box sx={{ boxShadow:" 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 "}}>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>
</BoxContain>
</Container>
  );
}

export default Cards
